__NUXT_JSONP__("/svet/stat/kapverdy", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s,t,u,v,w){return {data:[{tabsLoad:{tabWhatToSee:b,tabPrice:b,tabPeople:b,tabTrip:b,tabContact:b,tabHotel:b,tabNeighboring:f,tabVideos:f,tabArticles:f,tabWallSockets:l,tabChains:f,tabFauna:f,tabFlora:f,tabFoods:f,tabBrands:f},place:[{tld:".cv",name:"Kapverdy",area:4033,population:549935,slug:m,id_continent:h,information_chatgpt:"\u003Cp\u003EKapverdy jsou ostrovní stát nacházející se v Atlantském oceánu, přibližně 500 km západně od pobřeží Afriky. Tvoří ho 10 hlavních ostrovů a několik menších ostrůvků. Hlavním městem je Praia. Kapverdy mají rozlohu přibližně 4 tisíce km² a žije na nich přibližně půl milionu obyvatel.\u003C\u002Fp\u003E\n\u003Cp\u003EKapverdy jsou známé svou bohatou historií, která sahá až do 15. století, kdy byly objeveny portugalskými mořeplavci. V průběhu let se Kapverdy staly důležitým překladištěm otroků a také významným bodem na obchodních trasách mezi Evropou, Afrikou a Amerikou.\u003C\u002Fp\u003E\n\u003Cp\u003EDnes jsou Kapverdy oblíbeným turistickým cílem, zejména díky své krásné přírodě a plážím. Mezi nejznámější ostrovy patří Sal, Boa Vista a São Vicente. Kapverdy jsou také známé svou hudbou, kterou tvoří například morna, coladeira a funaná. V hlavním městě Praia se nachází například Muzeum kapverdské hudby.\u003C\u002Fp\u003E\n\u003Cp\u003EKapverdská kuchyně je ovlivněna africkou, portugalskou a brazilskou kuchyní. Mezi místní speciality patří například cachupa, směs fazolí, kukuřice a zeleniny, nebo lapas, mořské plody grilované na otevřeném ohni. Kapverdy jsou také známé svým místním vínem, které se vyrábí z hroznů pěstovaných na sopečných půdách.\u003C\u002Fp\u003E\n\u003Cp\u003EJe důležité si uvědomit, že Kapverdy jsou stále chudým státem s omezenými ekonomickými možnostmi. Turismus je pro Kapverdy velmi důležitým zdrojem příjmů, ale zároveň také může mít vliv na místní kulturu a životní styl. Přestože jsou Kapverdy relativně bezpečným místem pro cestování, je důležité být obezřetný a dodržovat základní bezpečnostní opatření.\u003C\u002Fp\u003E",money_prices:[{name:"Taxi (cena za km)",value:150,date_update:g},{name:"Hlavní jídlo",value:900,date_update:g},{name:"Chleba",value:n,date_update:g},{name:"Mléko",value:105,date_update:g},{name:"Voda (500ml)",value:60,date_update:g},{name:"Espresso",value:n,date_update:g},{name:"Zmrzlina (jeden kopeček)",value:200,date_update:g},{name:"Pivo",value:160,date_update:g},{name:"Krabička cigaret",value:750,date_update:g},{name:"Bic Mac",value:"Není k dispozici v Kapverdské republice",date_update:""},{name:"Coca Cola (500ml)",value:125,date_update:g}],phone_numbers_emergency:[{name:"Mezinárodní tísňová linka",value:"112",date_update:c},{name:"Policie",value:"132",date_update:c},{name:"Hasiči",value:"131",date_update:c},{name:"Zdravotnická záchranná služba",value:"130",date_update:c}],phone_prefix:"+238",coordinates:[{latitude:"16.5388",longitude:"-23.0418"}],people_religion:[{name:"Římskokatolická církev",value:"77.3%"},{name:"Církev Nazaretská",value:"4.7%"},{name:"Církev adventistů sedmého dne",value:"1.3%"},{name:"Jiné náboženství",value:"1.4%"},{name:"Bez vyznání",value:"15.3%"}],people_nationality:[{name:"Kapverdci",value:"71%"},{name:"Africké národnosti",value:"28%"},{name:"Evropané",value:"1%"}],visitors_entry:[{name:"Občanský průkaz",value:"Občanský průkaz není platným dokladem totožnosti pro vstup na Kapverdy. Pro vstup do země je třeba mít platný cestovní pas.",date_update:c},{name:"Cestovní pas",value:"Pro vstup na Kapverdy je třeba mít platný cestovní pas.",date_update:c},{name:"Vízum",value:"Pro pobyt do 30 dnů není pro občany České republiky vyžadováno vízum. Pokud plánujete pobyt delší než 30 dnů, je třeba si předem zažádat o vízum.",date_update:c},{name:"Očkování",value:"Při vstupu na Kapverdy není vyžadováno žádné specifické očkování. Doporučuje se však očkování proti žluté zimnici pro cestovatele, kteří přijíždějí z oblastí, kde je tato nemoc rozšířena.",date_update:c},{name:"Cestovní pojištění",value:"Cestovní pojištění není povinné, ale doporučuje se sjednat zdravotní pojištění pokrývající náklady na léčbu v zahraničí.",date_update:c},{name:"Bezpečnostní situace",value:"Kapverdy jsou považovány za relativně bezpečnou destinaci. Všude je však třeba dodržovat obvyklá bezpečnostní opatření, zejména v turistických centrech, kde se vyskytuje zvýšený výskyt kapesních krádeží a zlodějů.",date_update:c},{name:"Další informace",value:"Na Kapverdách je dobré mít při sobě hotovost, protože v mnoha obchodech a restauracích se neakceptují platební karty. Dále je třeba brát v úvahu vysoké teploty a silné slunce, proto je vhodné mít s sebou dostatek pitné vody, opalovací krém s vysokým ochranným faktorem a chrániče na hlavu. Pokud plánujete cestovat mimo hlavní turistické oblasti, může být užitečné naučit se základy portugalštiny, neboť se zde používá jako úřední jazyk.",date_update:c}],type_place:o,id_image_cover:i,id_image_hero:i,id_city_main:j,affiliate:[{name:p,value:b}],mpz:"CV",alerts:a,zoom:[{google:q,booking:q}],ids_neighboring_countries:[],organization:a,apps:a,links:a,information_author:a,seo_tags:a,language_phrases:a,wall_sockets:a,id:r,facts_place:a,created_at:"2023-12-27T16:33:10.517062+00:00",updated_at:"2024-03-04T19:48:12.84066+00:00",name_original:a,currency:[{code:"CVE",name:"kapverdské escudo"}],setting_top:b,setting_status_public:k}],imagePlace:[{id:i,name:m,source:"\u002Fworld\u002Fstates\u002F",type:o,author:"pixabay.com",created_at:"2023-05-03T20:14:00.749527+00:00",updated_at:"2023-12-27T20:42:18.520959+00:00"}],placesStatesNeighboring:a,imagesStatesNeighboring:a,placeContinent:[{id:h,slug:"afrika",name:"Afrika",area:30370000,population:1340000000,population_density:44.12,number_states:54,information_chatgpt:"\u003Cp\u003EAfrika je největší kontinent na Zemi a rozkládá se na ploše přesahující 30 milionů kilometrů čtverečních. Nachází se zde více než 50 zemí a žije zde více než 1,3 miliardy lidí. \u003C\u002Fp\u003E\n\u003Cp\u003EJižní Afrika, Egypt, Maroko a Keňa patří mezi nejoblíbenější turistické cíle v Africe. V Jihoafrické republice se můžete podívat na slavné Krugerův národní park a sledovat zde život zvířat v jejich přirozeném prostředí. Egypt je zase proslulý svými pyramidami, které se nacházejí v Gíze. V Maroku můžete navštívit tradiční trhy, zatímco v Keni se můžete setkat s Masajským kmenem a podívat se na úžasnou přírodu.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika má bohatou historii a kulturu. První lidé, kteří se usadili v Africe, byli loveckým a sběračským národem. Poté se v této oblasti objevily první civilizace, jako je Kúšská říše, Egyptská říše nebo Království Aksum. Afrika byla také kolonizována evropskými mocnostmi a toto období mělo značný dopad na dnešní politickou situaci na kontinentu.\u003C\u002Fp\u003E\n\u003Cp\u003EJe důležité zmínit, že Afrika má velké množství jazyků a kultur. Zahrnuje mnoho různých národů a etnických skupin, a to má vliv na různorodost obyvatelstva a kultury. Nejrozšířenějším jazykem je arabština, která se mluví především v severní Africe a v některých částech západní Afriky. Dalšími důležitými jazyky jsou svahilština, francouzština, portugalština, angličtina a mnoho dalších.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika má také nádhernou přírodu. Nachází se zde nejvyšší hora světa, Kilimandžáro, která se nachází na území Tanzanie a Keňy. Kromě toho se v Africe nachází také největší pouště na světě, Sahara, a největší prales, Kongský prales. Na tomto kontinentě můžete vidět také mnoho zvířat, jako jsou sloni, lvi, gepardi, zebry a mnoho dalších druhů. V Africe se také nachází několik nejvýznamnějších řek světa, jako je Nil, Kongo, Niger a Zambezi.\u003C\u002Fp\u003E\u003Cp\u003EAfrika je bohužel také známá pro své problémy. Mnoho zemí se potýká s chudobou, nedostatkem potravin a vody, nemocemi a válečnými konflikty. Mnoho afrických zemí závisí na zemědělství a rybolovu, což však často není dostatečně výnosné, aby zabezpečilo potřeby obyvatelstva. Kromě toho jsou některé země v Africe trvale postižené extrémními přírodními katastrofami, jako jsou sucha, povodně a bouře.\u003C\u002Fp\u003E\n\u003Cp\u003ENa druhou stranu se v Africe také nachází mnoho lidí, kteří se snaží změnit situaci a zlepšit životy svých spoluobčanů. Vznikají neziskové organizace, které se snaží pomáhat při řešení těchto problémů a zlepšovat kvalitu života v mnoha afrických zemích. Zároveň se v posledních letech objevují nové možnosti pro ekonomický růst a rozvoj, jako jsou technologické start-upy a zahraniční investice.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika je fascinující kontinent, který nabízí mnoho zážitků a zároveň v sobě ukrývá mnoho výzev. Pokud se rozhodnete navštívit Afriku, můžete se těšit na krásnou přírodu, bohatou kulturu a nezapomenutelné zážitky. Je však také důležité být obezřetný a připravený na místní podmínky, protože některé oblasti mohou být nebezpečné kvůli konfliktům nebo zločinnosti.\u003C\u002Fp\u003E",coordinates:[{latitude:1.650801,longitude:17.371642}],type_place:"continent",id_image_cover:h,id_image_hero:h,zoom:[{google:l,booking:3}],information_author:[{text:"\u003Cp\u003E\u003Cb\u003EAfrika\u003C\u002Fb\u003E, druhý největší a druhý nejlidnatější kontinent na světě, láká cestovatele svou neuvěřitelnou rozmanitostí kultur, přírodními krásami a bohatou historií. Při cestování touto obrovskou plochou se otevírá mozaika různorodých zážitků, které zahrnují odlesky moderního městského života, divokou přírodu až po historická místa.\u003C\u002Fp\u003E\u003Cp\u003EJižní Afrika, domov několika národních parků a rezervací, je rájem pro milovníky safari. \u003Cb\u003EKrugerův národní park (Kruger National Park)\u003C\u002Fb\u003E nabízí úžasné setkání s \"Velkým pětkou\" - slony, nosorožci, buvoly, lvy a levharty. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fcape-town\"\u003EKapské Město (Cape Town)\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s ikonickou horou \u003Cb\u003EMaclear's Beacon\u003C\u002Fb\u003E, poskytuje nezapomenutelný výhled na město a okolní krajinu.\u003C\u002Fp\u003E\u003Cp\u003EVýchodní Afrika je známá svými ohromujícími sopkami. \u003Cb\u003EKilimandžáro\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003ETanzanii\u003C\u002Fa\u003E\u003C\u002Fb\u003E, nejvyšší hora Afriky, přitahuje dobrodruhy a horolezce z celého světa. Návštěva \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003EZanzibaru\u003C\u002Fa\u003E\u003C\u002Fb\u003E s jeho bílými plážemi a historickým centrem \u003Cb\u003EStone Town\u003C\u002Fb\u003E přidává do cestovatelského mixu kouzlo exotiky.\u003C\u002Fp\u003E\u003Cp\u003EStřední Afrika, s obrovskou rovníkovou pralesní plochou, skrývá některé z nejzajímavějších biodiverzit na světě. \u003Cb\u003EKonžský deštný prales\u003C\u002Fb\u003E je po amazonském druhý největší na světě, je domovem vzácných druhů zvířat a rostlin, a expedice sem mohou odhalit tajemství dosud neobjevená.\u003C\u002Fp\u003E\u003Cp\u003ESeverní Afrika je poznamenána starověkými civilizacemi a písečnými pouštěmi. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fegypt\"\u003EEgypt\u003C\u002Fa\u003E\u003C\u002Fb\u003E s pyramidami a chrámy na březích \u003Cb\u003ENilu\u003C\u002Fb\u003E je jednou z nejnavštěvovanějších destinací v této části kontinentu. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmaroko\"\u003EMaroko\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s mistrovským spojením tradice a moderny v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fmarrakes\"\u003EMarrákeši\u003C\u002Fa\u003E\u003C\u002Fb\u003E, je fascinujícím mixem barev, vůní a architektury.\u003C\u002Fp\u003E\u003Cp\u003EZápadní Afrika, bohatá na kulturní dědictví, nabízí autentické zážitky. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fghana\"\u003EGhana\u003C\u002Fa\u003E\u003C\u002Fb\u003E s pevnostmi, které připomínají období otroctví, a kultovními festivaly představuje hluboký pohled do minulosti. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fsenegal\"\u003ESenegal\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s historickým ostrovem \u003Cb\u003EGorée\u003C\u002Fb\u003E, který sehral roli s obchodem s otroky, kde najdete koloniální budovy a muzeum \u003Cb\u003EHouse of Slaves (Maison des esclaves)\u003C\u002Fb\u003E.\u003C\u002Fp\u003E\u003Cp\u003EAfrika je rovněž známá svými divokými zvířaty. Kromě safari v jižní části kontinentu můžete zažít jedinečnou příležitost sledovat migraci tisíců zeber a gazel v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fkena\"\u003EKeni\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003ETanzanii\u003C\u002Fa\u003E\u003C\u002Fb\u003E. Návštěva gorilí v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Frwanda\"\u003ERwandě\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fuganda\"\u003EUgandě\u003C\u002Fa\u003E\u003C\u002Fb\u003E je neopakovatelným zážitkem pro ty, kteří touží po setkání s těmito ohroženými tvory.\u003C\u002Fp\u003E\u003Cp\u003EPřírodní skvosty nejsou omezeny pouze na pevninskou část kontinentu. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fseychely\"\u003ESeychely\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmauricius\"\u003EMauricius\u003C\u002Fa\u003E\u003C\u002Fb\u003E, dvě ostrůvky v \u003Cb\u003EIndickém oceánu\u003C\u002Fb\u003E, lákají svými bílými plážemi, průzračnými vodami a jedinečnou faunou a florou.\u003C\u002Fp\u003E\u003Cp\u003EAfrika rovněž hýří kulturou a historií. Starověké památky jako \u003Cb\u003EGreat Zimbabwe National Monument\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fzimbabwe\"\u003EZimbabwe\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003ETimbuktu (Tombouctou)\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmauricius\"\u003EMali\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou svědectvím o bohaté historii a rozvoji obchodu a kultury na africkém kontinentu. Každý region má své vlastní tradiční tance, hudbu a umění, které odrážejí místní identitu a historii.\u003C\u002Fp\u003E\u003Cp\u003ECestování Afrikou je také o interakci s místními lidmi. Přívětivost a pohostinnost afrických komunit jsou nezapomenutelnými součástmi cestování. Místní trhy nabízejí pestrou škálu barev, vůní a chutí, zatímco setkání s kmeny a etnickými skupinami přináší pochopení různorodosti kultur a tradic.\u003C\u002Fp\u003E\u003Cp\u003EJe však důležité si být vědomý sociálních, ekonomických a environmentálních výzev, kterým mnohé africké země čelí. Cestovatelé by měli být respektující vůči místním zvyklostem a životnímu prostředí a přispívat k udržitelnému turismu, který podporuje místní ekonomiky a ochranu přírodních zdrojů.\u003C\u002Fp\u003E\u003Cp\u003ECelkově lze říci, že cestování po Africe je dobrodružstvím naplněným kontrasty a překvapeními. Od rozlehlých savan po exotické pláže, od starověkých ruin po moderní metropole. Afrika nabízí cestovatelům nekonečné možnosti objevování a poznávání. Je to kontinent, který zanechává nezapomenutelný dojem na každém, kdo se odhodlá k jeho prozkoumání.\u003C\u002Fp\u003E",date_create:s,date_update:s,author_create:t,author_update:t}],seo_tags:[],created_at:"2023-12-27T16:35:37.460505+00:00",updated_at:"2024-03-04T19:48:06.634661+00:00",name_original:"Africa",setting_top:b,setting_status_public:k}],placesCities:[{id:493,id_image_cover:a,importance:d,slug:"assomada",type_place:e,name:"Assomada"},{id:496,id_image_cover:a,importance:d,slug:"espargos",type_place:e,name:"Espargos"},{id:489,id_image_cover:a,importance:d,slug:"mindelo",type_place:e,name:"Mindelo"},{id:495,id_image_cover:a,importance:d,slug:"porto-novo--stat-kapverdy",type_place:e,name:"Porto Novo"},{id:j,id_image_cover:a,importance:d,slug:u,type_place:e,name:v},{id:491,id_image_cover:a,importance:d,slug:"santa-cruz--stat-kapverdy",type_place:e,name:"Santa Cruz"},{id:490,id_image_cover:a,importance:d,slug:"santa-maria",type_place:e,name:"Santa Maria"},{id:492,id_image_cover:a,importance:d,slug:"sao-filipe",type_place:e,name:"São Filipe"},{id:494,id_image_cover:a,importance:d,slug:"tarrafal",type_place:e,name:"Tarrafal"},{id:497,id_image_cover:a,importance:d,slug:"vila-da-ribeira-brava",type_place:e,name:"Vila da Ribeira Brava"}],imagesCities:a,placeCityMain:[{id:j,id_state:r,name:v,population:136835,area:100.28,altitude:f,slug:u,information_chatgpt:"\u003Cp\u003EPraia je hlavní město Kapverdské republiky a nachází se na ostrově Santiago. Leží na jihozápadním pobřeží ostrova a je největším městem v zemi. Praia je jedním z nejvýznamnějších ekonomických, politických a kulturních center Kapverd. \u003C\u002Fp\u003E\n\u003Cp\u003EMěsto je známé svými krásnými plážemi, z nichž nejznámější je Quebra Canela. Tato písečná pláž s tyrkysově modrou vodou je oblíbeným místem pro rekreaci, opalování a vodní aktivity. Další populární pláže zahrnují pláže Kebra Kanela, Gamboa a Prainha.\u003C\u002Fp\u003E\n\u003Cp\u003EV centru města se nachází historická čtvrť Plateau, která je zapsaná na seznamu UNESCO. Plateau je plná malebných uliček, koloniální architektury a historických budov. Zde můžete navštívit také Národní archeologické muzeum Kapverd, kde jsou vystaveny artefakty a předměty týkající se historie Kapverd.\u003C\u002Fp\u003E\n\u003Cp\u003EDalší zajímavé místo, které stojí za návštěvu, je přístav Praia. Můžete se procházet po přístavní promenádě, sledovat rybáře při jejich každodenní práci a ochutnat čerstvé mořské plody v jedné z místních restaurací.\u003C\u002Fp\u003E\n\u003Cp\u003EV okolí Praie se nachází i několik zajímavých přírodních lokalit. Na východ od města se tyčí pohoří Serra Malagueta, které nabízí skvělé možnosti pro pěší turistiku a trekking. Nedaleko se nachází také přírodní rezervace Serra do Pico de Antónia, kde můžete obdivovat rozmanitou flóru a faunu ostrova Santiago.\u003C\u002Fp\u003E\n\u003Cp\u003EPraia je také centrem kapverdského kulturního života. V městě se koná mnoho hudebních a tanečních festivalů, jako je například festival Gamboa, který představuje kapverdskou hudbu, tance a kulturu. Můžete si také vychutnat tradiční kapverdskou kuchyni v některé z místních restaurací.\u003C\u002Fp\u003E\n\u003Cp\u003EPraia je fascinujícím městem s bohatou historií, překrásnými plážemi a živou kulturou. Je ideálním místem pro ty, kteří chtějí objevovat krásy Kapverd a poznávat místní tradice a zvyky.\u003C\u002Fp\u003E",coordinates:[{latitude:14.9215,longitude:-23.5087}],biggest:"yes",type_place:e,id_image_cover:a,id_image_hero:a,affiliate:[{name:p,value:b}],alerts:a,zoom:[{google:10,booking:11}],parking:a,information_author:a,importance:d,seo_tags:a,created_at:"2023-12-27T16:36:26.534285+00:00",updated_at:"2024-03-04T19:48:29.85915+00:00",name_original:a,setting_top:b,setting_status_public:k}],imageCityMain:a}],fetch:{"OrganismsoSidebarEventComponent:0":{events:[],images:a,imageSizesMedia:[{mediaQueriesWidth:a,elementWidth:f}],imageSizes:[{elementWidth:w,imageWidth:w,orientation:"s-"}]}},mutations:[]}}(null,true,"05-2023","biggest","city",0,"leden 2021",5,285,488,1,2,"kapverdy",70,"state","booking",7,52,"2024-03-01","1","praia","Praia",100)));